import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";
import HalfSection from "./Components/HalfSection.js";

import front from './images/front.jpeg'
let content= <h1>This is a custom heading</h1>;
let content2 = <div><img src={front} className="front-picture" alt="Front Picture"/><div className ='front_text_box'><div className='front_text'> Ryan Davis</div></div></div>;
let halfContent1 = 'hi';
let content3 = <div><halfSection body = {halfContent1} id="halfSection1"></halfSection> </div>;
class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
       <Section
          body={content2}
          id="section1"
        />
        <section
          body = {content3}
          id='section2'
        />
      </div>
    );
  }
}

export default App;
